function showAll() {
    var rowVertPos = 5;
    for (i=44032; i<55204; i++) {
        if (i % 28 == 16) {
            var rowBlock = document.createElement("div");
            document.getElementById("container").appendChild(rowBlock);
        }

        var block = document.createElement("span");
        var textContent = document.createTextNode(String.fromCharCode(i));
        block.appendChild(textContent);
        rowBlock.appendChild(block);
        //var elementForInsertion = document.getElementById("container");


        block.setAttribute('id','char'+i);

        redV = 100-freqDict['char'+i]*100;
        greenV = 100-freqDict['char'+i]*100;
        blueV = 100-freqDict['char'+i]*100;

        //block.style.backgroundColor = bkgdColorArray[i%2];
        block.style.backgroundColor = "rgb(" + redV + "%," + greenV + "%," + blueV + "%)";
        block.style.width = "100px";
        block.style.fontSize = "18pt";
        if (redV < 45) {
            block.style.color = "#FFFFFF";
        }

        block.setAttribute('onclick','showSpecific(this)');

    }
}

function showSpecific(elem) {
    document.getElementById("specific").style.display = "block";
    document.getElementById("specificBlockBigDisplay").innerHTML = String.fromCharCode(elem.id.slice(4,9));
    var dictVal = freqDict["char" + elem.id.slice(4,9)]
    document.getElementById("specificDetails").innerHTML = "instances in corpus: " + Math.round(10 ** (dictVal*7.17268911027) - 1);
    document.getElementById("specificDetails").innerHTML += "<br>proportion of max (" + String.fromCharCode(45796) + "): " + Math.round((Math.round(10 ** (dictVal*7.17268911027) - 1) / 14882952)*10000000) / 10000000;
    document.getElementById("specificDetails").innerHTML += "<br>rank: " + sortedValues.indexOf(dictVal);
    //document.getElementById("specificDetails").innerHTML += "<br>rank: " + sortedValues.findIndex(dictVal);
    document.getElementById("specificDetails").innerHTML += "<br>color value: " + dictVal;
    document.getElementById("specificDetails").innerHTML += "<br>log: " + (dictVal * 7.17268911027);
}

function switchToBW() {
    for (i=44032; i<55204; i++) {
        var thisVal = 100-freqDict['char'+i]*100;
        document.getElementById("char"+i).style.backgroundColor = "rgb(" + thisVal + "%," + thisVal + "%," + thisVal + "%)";
        if (thisVal < 45) {
            document.getElementById("char"+i).style.color = "#FFFFFF";
        }
        else {
            document.getElementById("char"+i).style.color = "#000000";
        }
    }
}

function switchToHSL() {
    for (i=44032; i<55204; i++) {
        var thisVal = (1-freqDict["char"+i])*240; //freqDict["char" + (elem+44032)];
        document.getElementById("char"+i).style.backgroundColor = "hsl(" + thisVal + ",100%,50%)";
        if (thisVal > 200) {
            document.getElementById("char"+i).style.color = "#FFFFFF";
        }
        else {
            document.getElementById("char"+i).style.color = "#000000";
        }
    }
}
